import { TableRowHeader } from 'modules';
import { LossActionRow } from './LossActionRow';
import { LossActionLevelThree } from './LossActionLevelThree';

export function LossActionLevelTwo({data, columnProps, isOpen, setIsOpen}){
    
    return data.actionChildItemList.map((itemLevelTwo, index) => {
            return itemLevelTwo.isClaim 
              ?
              <TableRowHeader 
                title={`Claim ${itemLevelTwo.claimRef}`}
                subtitle="International Energy - Plant, Machinery and Equipment - Terraseis 1040 Limited"
                expanded={isOpen}
                setIsOpen={setIsOpen}
                padding={25}
                color='yellow'
              >
                {itemLevelTwo.actionChildItemList.map((itemLevelThree, index) => {
                  return(
                    <>
                      <LossActionRow
                        columnProps={columnProps}
                        data={itemLevelThree}
                        padding={35}
                        color="green"
                      />
                     <LossActionLevelThree 
                        data={itemLevelThree}
                        columnProps={columnProps}
                     />
                    </>
                  )
                })}
              </TableRowHeader>
              :
              <LossActionRow
                columnProps={columnProps}
                data={itemLevelTwo}
                padding={25}
                color='yellow'
              />
              
          });
  
}
